        // Matrix/Vector operations
        // - 2D matrices represented by array of arrays
        // - column vectors represented by 1D arrays
        //  (I know there are libraries that will do all this faster and better,
        //  but I want to keep my build process as simple as possible for now.)

        function dot(vectorA, vectorB) {
            var total = 0
            if (vectorA.length === vectorB.length ) {
                for(let i = 0; i < vectorA.length; i += 1 ) {
                    total += vectorA[i] * vectorB[i];
                }
            } else {
                console.error ("dot called with bad lengths" + vectorA.length + "," + vectorB.length)
            }

            return total;
        }

        function add(vectorA, vectorB) {
            if (vectorA.length === vectorB.length ) {
                return vectorA.map( function(value, index) {
                    return value + vectorB[index]
                });
            } else {
                console.error ("add called with bad lengths" + vectorA.length + "," + vectorB.length)
            }
        }

        function multiply(matrix, vector) {
            return matrix.map((row) => dot(row, vector))
        }

        // Turn two lists into one list of "tuples"
        // eg: zip([1,2,3],['a','b','c']) => [[1,'a'],[2,'b',3,'c']]
        function zip(a, b) {
            return a.map((val, i) => [val, b[i]]);
        }


        // Neural network functions

        function sigmoid(x) {
            return 1.0 / (1.0 + Math.exp(-x));
        }

        // Calculate activations of a single layer
        function activation(weights, biases, prevActivation) {
            return add(
                multiply(weights, prevActivation)
                , biases
            ).map(sigmoid)
        }

        // Run an input through the whole network
        function feedforward(weights, biases, input) {
            let wb = zip(weights, biases);

            return wb.reduce(
                (act, wbi, index) => activation(wbi[0], wbi[1], act)
                , input
            );
        }

        // Take list of activations for output layer of network and
        // convert to digit
        function outputToDigit(output) {
            let maxValue = output.reduce((a, b) => Math.max(a, b));
            return output.findIndex((a) => (a === maxValue));
        }
